import React, { Component } from 'react';
import Login from './components/login';

class App extends Component {
  componentDidMount() {
    document.title="My React Login - Jimmy Bui";
  }

  render() {
    return (
      <div id="app">
        Hello
      </div>
    )
  }
}

export default App;
